using System;
using System.Collections.Generic;
using System.ComponentModel;
using System.Linq;
using System.Text;
using System.Threading.Tasks;
using Microsoft.AspNetCore.Mvc;
using Resume01.Extensions;
using Resume01.Models;
using ResumeDto;

namespace Resume01.Controllers
{
    public class BaseController : Controller
    {
        protected ResponseModel response;
        protected string[] uriParams;
        public BaseController()
        {
            response = new ResponseModel();
            uriParams = new string[0];
        }

        [ReadOnly(true)]
        public AuthorizedUserModel UserInfo
        {
            get
            {
                return HttpContext.Session.Get<AuthorizedUserModel>(SESSIONID.USER_INFO);
            }
        }

        [ReadOnly(true)]
        public string Username
        {
            get
            {
                return User?.Claims.FirstOrDefault(c => c.Type.EndsWith("claims/sid"))?.Value; ;
            }
        }
        public string FullName
        {
            get
            {
                return User?.Claims.FirstOrDefault(c => c.Type.EndsWith("claims/name"))?.Value; ;
            }
        }
        [ReadOnly(true)]
        public string UserType
        {
            get
            {
                return User?.Claims.FirstOrDefault(c => c.Type.EndsWith("claims/actor"))?.Value; ;
            }
        }

        [ReadOnly(true)]
        public string BusinessId
        {
            get
            {
                return User?.Claims.FirstOrDefault(c => c.Type.EndsWith("claims/system"))?.Value; ;
            }
        }

        [ReadOnly(true)]
        public string EMail
        {
            get
            {
                return User?.Claims.FirstOrDefault(c => c.Type.EndsWith("claims/email"))?.Value; ;
            }
        }

        [ReadOnly(true)]
        public string RoleId
        {
            get
            {
                return User?.Claims.FirstOrDefault(c => c.Type.EndsWith("claims/role"))?.Value; ;
            }
        }

        [ReadOnly(true)]
        public string Manager
        {
            get
            {
                return User?.Claims.FirstOrDefault(c => c.Type.EndsWith("claims/primarysid"))?.Value; ;
            }
        }

        static public string encodeUri(string plainText)
        {
            var e = Encoding.GetEncoding("iso-8859-1");
            byte[] plainTextBytes = e.GetBytes(plainText);
            string returnValue = System.Convert.ToBase64String(plainTextBytes);
            return returnValue;
        }
        protected string[] decodeUri(string id)
        {
            try
            {
                var e = Encoding.GetEncoding("iso-8859-1");
                byte[] encodedDataAsBytes = System.Convert.FromBase64String(id);
                string returnValue = e.GetString(encodedDataAsBytes);
                //return returnValue;
                uriParams = returnValue.Split('|');
            }
            catch (Exception)
            {
                //throw;
            }

            return uriParams;
        }

        protected string decodeStr(string id)
        {
            var e = Encoding.GetEncoding("iso-8859-1");
            byte[] decodedDataAsBytes = System.Convert.FromBase64String(id);
            string returnValue = e.GetString(decodedDataAsBytes);

            return returnValue;
        }
        protected string encodeStr(string id)
        {
            var e = Encoding.GetEncoding("iso-8859-1");
            byte[] encodedDataAsBytes = e.GetBytes(id);
            string returnValue = Convert.ToBase64String(encodedDataAsBytes);

            return returnValue;
        }

        public static string DateStringToVarchar10(string DateString)
        {
            DateString = string.IsNullOrEmpty(DateString) ? string.Empty : DateString;
            if (DateString == "__/__/____")
                DateString = string.Empty;

            //01/12/2560 12:35
            if (DateString.Length == 10)
            {
                int yearNum = Convert.ToInt32(DateString.Substring(6, 4));   //2560
                yearNum = yearNum >= 2100 ? yearNum - 543 : yearNum;    //2017
                DateString = yearNum.ToString() + "-" + DateString.Substring(3, 2) + "-" + DateString.Substring(0, 2);
            }
            else
                DateString = string.Empty;

            return DateString;

        }

        protected static string noImage60 = "data:image/jpeg;base64,";
        protected static string noImage256 = "data:image/jpeg;base64,";
    }
}